import React from "react";

import { fetchAPI } from "../l";

const Landingpage = ({ articles, categories, homepage, global, writers }) => {
   
  // <h1>{global.siteName}</h1>
  <div class="container">
  <div class="card">
    <h3 class="title">Card 1</h3>
    <div class="bar">
      <div class="emptybar"></div>
      <div class="filledbar"></div>
    </div>
    <div class="circle">
      <svg version="1.1" xmlns="http://www.w3.org/2000/svg">
      <circle class="stroke" cx="60" cy="60" r="50"/>
    </svg>
    </div>
    </div>
    </div>
    
}

export async function getStaticProps() {
    // Run API calls in parallel
    const [articles, categories, homepage, global, landingpage, writers] = await Promise.all([
      fetchAPI("/articles?status=published"),
      fetchAPI("/categories"),
      fetchAPI("/homepage"),
      fetchAPI("/global"),
      fetchAPI("/landing-page"),
      fetchAPI("/writers")
    ]);
  
    return {
      props: { articles, categories, homepage, global, landingpage, writers },
      revalidate: 1,
    };
  }
  
  export default Home;
